import '../App.css'
import React, { useState, useEffect } from "react"
import Table from 'react-bootstrap/Table';


const CreateSession = () => {

  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);

  const createSesssionRequest = {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' }
};

  useEffect(() => {
    setLoading(true);
    fetch("http://localhost:8080/restaurant/api/v1/createSession/ashutosh.bhardwaj@gmail.com", createSesssionRequest)
      .then((response) => response.json())
      .then((json) => setData(json))
      .finally(() => {
        setLoading(false);
      });
  }, []);

  return (
    <Table striped bordered hover size="sm">
        <thead>
            <tr>
                <th>Session Id</th>
                 <th>Session Requested By</th>
                 <th>Status</th>
            </tr>
        </thead>

        <tbody>
            {
                 <tr key={data.restaurantName}>
                 <td>{data.restaurantName}</td>
                 <td>{data.restaurantAddedBy}</td>
                 <td>{data.sessionId}</td>
               </tr>
            }
        </tbody>
    </Table>);
}
export default CreateSession;
